import React from "react";
import { CgProfile } from "react-icons/cg";


const Dashboard = () => {
	return (
		<>
			<div>
				<h1>Dashboard</h1>
				<CgProfile size="10rem" />
			</div>
		</>
	);
};

export default Dashboard;
